import React from 'react';
import ReactDOM from 'react-dom';

const age = 25

const Hello = (props) => {
  return (
    <div>
      <p>My name is {props.name}. I am {props.age} years old.</p>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="Damilola" age={age + 7}/>
      <Hello name="Jumoke" age={age + 10}/>
      <Hello name="Seyi" age={age}/>
    </div>
  )
}

ReactDOM.render(<App />, document.getElementById('root'));
